import React from "react"
import Paper from '@material-ui/core/Paper';
import { Link } from "react-router-dom";
import HighlightText from './HighlightText';

interface ItemLeagues {
	index: number,
	id: number | string,
	name: string
	searchValue?: string | undefined
}

const ItemLeagues = (props: ItemLeagues) => {
	return (
		<Link to={`/leagues/${props.id}`}>
			<Paper
				className={'ItemLeagues'}
				elevation={0}
			>
				<span style={{ fontSize: "10px" }}><HighlightText searchValue={props.searchValue}>id Лиги - {props.id}</HighlightText></span>
				<br />
				<span>{props.index}. </span>
				<span>{props.name} </span>
			</Paper>
		</Link>
	)
}

export default ItemLeagues;
